import { type } from 'os';
import React, {useEffect, useState} from 'react'
type Props = {category: String}
type Product = {
                  id: Number,
                  title: String,
                  price: String,
                  category: String,
                  description: String,
                  image: String
                }

const Products: React.FC<Props> = ( {category} ): JSX.Element => {
  let [data, setData] = useState<Product[]>([])
  useEffect(() => {
    fetch('https://fakestoreapi.com/products/category/jewelery')
            .then(res=>res.json())
            .then(json=>{console.log(json); setData(json)})
  });
  return (
    <div>{category}</div>
  )
}

export default Products
